    data: |
      SELECT ALL col2 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT - col2 + + col2 - - - col1 * col2 / 90 * + col1 * - col2 IS NULL;
  - name: tab0

outputs:
  - name: q2769.out
    data: |
      10
      47
      99
